import React, {Component} from 'react';
import { NavLink } from 'react-router-dom';
import styles from 'style';


class Navbar extends Component{
  render(){
    this.state = {
      color: 'red'
    }
    const display = () => {
       this.setState({ color: 'green' });
    }
    return(
        <React.Fragment>
          
            <div className="container-fluid">
                <div className="row">
                    <div className="col-10 mx-auto">

            <nav className="navbar navbar-expand-lg navbar-light">
  <div className="container-fluid">
    <NavLink exact className="navbar-brand" to="/">SanPage</NavLink>
    <button style={{ backgroundColor: this.state.color }} 
       onClick={thdisplay} className="navbar-toggler" type="button" data-bs-toggle="navbar-mobile"   aria-expanded="false" aria-label="Toggle navigation">
      <span className="navbar-toggler-icon"></span>
    </button>
    <div className="navbar-mobile navbar-collapse">
      <ul className="navbar-nav ml-auto mb-2 mb-lg-0">

        
        <li className="nav-item">
          <NavLink exact className="nav-link" activeClassName="menu_active" to="/">Home</NavLink>
        </li>
        <li className="nav-item">
          <NavLink exact className="nav-link" activeClassName="menu_active" to="/service">Service</NavLink>
        </li>
        <li className="nav-item">
          <NavLink exact className="nav-link" activeClassName="menu_active" to="/contact">Contact</NavLink>
        </li>
        <li className="nav-item">
          <NavLink exact className="nav-link" activeClassName="menu_active" to="/about">About</NavLink>
        </li>
      </ul>
    
    </div>
  </div>
</nav>

</div>
</div>
</div>
        </React.Fragment>
    );}
}
export default Navbar;
